import Box from '@mui/material/Box';
import { Typography } from '@mui/material';
import Grid from '@mui/material/Grid';


function Contact (){
    return(
        <div>
            <Box>
                <Grid align='center'>
                <Grid>
                    <h4>Our Services</h4>
                </Grid>
                <Grid>
                    <h1>We focus on your beauty</h1>
                </Grid>

                </Grid>
            </Box>

        </div>
    )
}

export default Contact
